| APICTag of string * int

(** val beq_ptag : physicalTag -> physicalTag -> bool **)

let beq_ptag a b =
  match a with
  | PTag a1 ->
    (match b with
     | PTag b1 -> Nat.eqb a1 b1
     | _ -> false)
  | PTETag a1 ->
    (match b with
     | PTETag b1 -> Nat.eqb a1 b1
     | _ -> false)
  | APICTag (a1, a2) ->
    (match b with
     | APICTag (b1, b2) -> if beq_string a1 b1 then Nat.eqb a2 b2 else false
     | _ -> false)

