(** val match_pte_status : pTEStatus -> accessedStatus -> dirtyStatus -> bool **)

let match_pte_status s a d =
  let p = Pair ((Pair (s.accessed, a)), s.dirty) in
  let Pair (p0, b) = p in
  let Pair (b0, a0) = p0 in
  if b0
  then (match a0 with
        | NotAccessed -> false
        | _ ->
          if b
          then (match d with
                | NotDirty -> false
                | _ -> true)
          else (match d with
                | Dirty -> false
                | _ -> true))
  else (match a0 with
        | Accessed -> false
        | _ ->
          if b
          then (match d with
                | NotDirty -> false
                | _ -> true)
          else (match d with
                | Dirty -> false
                | _ -> true))

