(** val vAPASameTagAndIndex : virtualAddress -> physicalAddress -> bool **)

let vAPASameTagAndIndex v p =
  let { vtag = vt; vindex = vi } = v in
  let { ptag = ptag0; pindex = pi } = p in
  (match ptag0 with
   | PTag pt -> if Nat.eqb vt pt then Nat.eqb vi pi else false
   | _ -> false)

