let rec sortMicroopsInsertionSortHelper g l r uop =
  match l with
  | [] -> app_rev (uop::[]) r
  | h::t -> if blt_uop g uop h then app_rev (uop::l) r else sortMicroopsInsertionSortHelper g t (h::r) uop

