| ScenarioEdgeLeaf l -> Pair ((Pair ([], [])), l)
| ScenarioNodeLeaf l -> Pair ((Pair (l, [])), [])
| ScenarioNotNodeLeaf l -> Pair ((Pair ([], l)), [])
| ScenarioFalse ->
  warning (Pair ((Pair ([], [])), []))
