(** val findBranchingEdges : scenarioTree -> graphEdge list list option **)

let rec findBranchingEdges = function
| ScenarioName (_, s0) -> findBranchingEdges s0
| ScenarioAnd (a, b) ->
  (match findBranchingEdges a with
   | Some a' ->
     (match a' with
      | [] -> Some a'
      | a1::l ->
        (match l with
         | [] ->
           (match findBranchingEdges b with
            | Some b' ->
              (match b' with
               | [] -> Some b'
               | b1::l0 ->
                 (match l0 with
                  | [] -> Some ((app_rev a1 b1)::[])
                  | _::_ -> Some b'))
            | None -> Some (a1::[]))
         | _::_ -> Some a'))
   | None -> findBranchingEdges b)
| ScenarioOr (a, b) ->
  (match findBranchingEdges a with
   | Some l ->
     (match l with
      | [] ->
        (match findBranchingEdges b with
         | Some l' ->
           (match l' with
            | [] -> Some (app_rev l l')
            | l'0::l0 ->
              (match l0 with
               | [] -> Some (l'0::l)
               | _::_ -> Some (app_rev l l')))
         | None -> Some l)
      | l0::l1 ->
        (match l1 with
         | [] ->
           (match findBranchingEdges b with
            | Some l' ->
              (match l' with
               | [] -> Some (l0::l')
               | l'0::l2 ->
                 (match l2 with
                  | [] -> Some (l0::(l'0::[]))
                  | _::_ -> Some (l0::l')))
            | None -> Some (l0::[]))
         | _::_ ->
           (match findBranchingEdges b with
            | Some l' ->
              (match l' with
               | [] -> Some (app_rev l l')
               | l'0::l2 ->
                 (match l2 with
                  | [] -> Some (l'0::l)
                  | _::_ -> Some (app_rev l l')))
            | None -> Some l)))
   | None -> None)
| ScenarioEdgeLeaf l ->
  (match l with
   | [] -> None
   | _::_ -> Some (l::[]))
| ScenarioNodeLeaf _ -> Some []
| ScenarioNotNodeLeaf _ -> Some []
| _ -> None

