(** val fOLImplies : fOLFormula -> fOLFormula -> fOLFormula **)

let fOLImplies a b =
  FOLOr ((FOLNot a), b)

(** val fOLIff : fOLFormula -> fOLFormula -> fOLFormula **)

let fOLIff a b =
  FOLAnd ((fOLImplies a b), (fOLImplies b a))

